import React, { useState } from "react";
import "./LoginPage.css";
import foto from "../asset/image2.png";
import { NavLink } from "react-router-dom";
import axios from "axios";

const Header = () => {
    return (
      <div className="headerContainer">
        <div className="headerSignup">Sign up</div>
      </div>
    );
  };

  const Form = () => {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [npa, setNpa] = useState("");
    const [fullName, setFullname] = useState("");

    const changeUsername = (text) => {
      setUsername(text.target.value);
      console.log(username);
    };

    const changePassword = (text) => {
      setPassword(text.target.value);
      console.log(password);
    };

    const changeNpa = (text) => {
        setNpa(text.target.value);
        console.log(npa);
      };

      const changeFullname = (text) => {
        setFullname(text.target.value);
        console.log(fullName);
      };





    return (
      <div className="utamaContainer">

        <div className="komponenSatu">
          <div className="formContainer">

            <div className="formItem">
              <div className="formLabel">NPA</div>
              <input
              type="tel"
              className="inputText"
              name="npa"
              pattern="[0-9]{11}"
              value={npa}
              onChange={changeNpa}
              onKeyUp={changeNpa}
              required
            />

            </div>

            <div className="formItem">
              <div className="formLabel">Full Name</div>
              <input
                type="text"
                className="inputText"
                name="fullname"
                value={fullName}
                onChange={changeFullname}
                onKeyUp={changeFullname}
                required
              />
            </div>

            <div className="formItem">
              <div className="formLabel">Phone</div>
              <input
              type="tel"
              className="inputText"
              name="nomorHp"
              pattern="[0-9]{11}"
              required
            />
            </div>

            <div className="formItem">
              <div className="formLabel">Email</div>
              <input
                type="email"
                className="inputText"
                name="email"

              />
            </div>

            <div className="formItem">
              <div className="formLabel">Username</div>
              <input
                type="text"
                className="inputText"
                name="username"
                value={username}
                onChange={changeUsername}
                onKeyUp={changeUsername}
              />
            </div>

            <div className="formItem">
              <div className="formLabel">Password</div>
              <input
                type="password"
                className="inputText"
                name="password"
                value={password}
                onChange={changePassword}
                onKeyUp={changePassword}
              />
            </div>

            <NavLink to="/" className="formBtn">
              <button > Sign up</button>
            </NavLink>

            <NavLink to="/login" className="btnSignup">have an account? Login</NavLink>

          </div>
        </div>
      </div>
    );
  };

  const SignupContainer = () => {
    return (
      <div className="loginContainer">
        <Form />
      </div>
    );
  };

  export default SignupContainer;
